import React from 'react';
import Template from './Templates/Simple';
import CvForm from './CvForm/CvForm';
import styled from 'styled-components';


const Half = styled.div`
  width: 45%;
`

const Wrapper = styled.div`
    display: flex;
    flex-direct: row;
`


const App = () => {
    return (
        <Wrapper>
            <Half>
                <Template/>
            </Half>
            <Half>
                <CvForm/>
            </Half>
        </Wrapper>
    )
  }

export default App;
